import React from 'react';


const Navbar = () => {
  return (
    <div className="navbar">
      <nav className="btn-group">
      <div className="logo">
      <img src='/images/logo.png' alt=" Logo" />
      </div>
        <span className="btn-group__item" data-category="breakfast">Breakfast</span>
        <span className="btn-group__item" data-category="evening">Evening</span>
        <span className="btn-group__item" data-category="lunch">Lunch</span>
        <span className="btn-group__item" data-category="dinner">Dinner</span>
        <span className="btn-group__item" data-category="all">All</span>
        <span href='AboutMe.jsx' className="btn-group__item">About us</span>
        <h1 className="btn-group__item">Discover good taste with us</h1>
      </nav>
    </div>
  );
};

export default Navbar;
